import React from 'react'
import '././styles/input.css'

const Home = () => {
    return (
        <div className="xl:container mx-auto grid place-items-center h-screen">
            <div className="grid">
                <div className="grid">
                    <h1 className='p-3 font-mono text-2xl font-bold'>Hello World</h1>
                </div>
            </div>
        </div>
    )
}

export default Home;
